  false,\n\t\"url\": null,\n\t\"notes\": \"The Chicago Department of Public Health
  (CDPH) Division of STD/HIV/AIDS Public Policy and Programs works in partnership
  with communities to advance the prevention and treatment of HIV and sexually transmitted
  infections (STIs).  CDPH maintains drop-in STI Specialty Clinics & HIV Early Intervention
  Services in South Austin, Englewood, Roseland, Lakeview and West Town that diagnose
  and treat STIs and provide information about condom use and other STI prevention
  methods.  These clinics are offered at no cost, and on a first-come, first-serve
  basis.  This metric tracks the percent of patients served by the STI Specialty Clinics
  per month out of the total number of people who seek care.  The monthly performance
  goal is to serve 100% of those seeking care.  For more information about City STI/HIV/AIDS
  Services, see http://www.cityofchicago.org/city/en/depts/cdph/provdrs/sti_hiv_aids.html\",\n\t\"license_title\":
